ter in a large pan and fry the mushrooms on medium heat, with 1 large sprig fresh thyme, for about 10 mins stirring often, until you have a softened mixture.\nSTEP 5 Season the mushroom mixture, pour over 100ml dry white wine, and cook for about 10 mins until all the wine has been absorbed. The mixture should hold its shape when stirred.\nSTEP 6 Remove the mushroom duxelle from the pan to cool and discard the thyme.\nSTEP 7 Overlap two pieces of cling film over a large chopping board. Lay 12 slices of prosciutto on the cling film, slightly overlapping, in a double row.\nSTEP 8 Spread half the duxelles over the prosciutto, then sit the fillet on it and spread the remaining duxelles over.\nSTEP 9 Use the cling film’s edges to draw the prosciutto around the fillet, then roll it into a sausage shape, twisting the ends of cling film to tighten it as you go.\nSTEP 10 Chill the fillet while you roll out the pastry.\nSTEP 11 Dust your work surface with a little flour. Roll out a third of the 500g pack of puff pastry to an 18 x 30cm strip and place on a non-stick baking sheet.\nSTEP 12 Roll out the remainder of the 500g pack of puff pastry to about 28 x 36cm.\nSTEP 13 Unravel the fillet from the cling film and sit it in the center of the smaller strip of pastry.\nSTEP 14 Beat the 2 egg yolks with 1 tsp water and brush the pastry’s edges, and the top and sides of the wrapped fillet.\nSTEP 15 Using a rolling pin, carefully lift and drape the larger piece of pastry over the fillet, pressing well into the sides.\nSTEP 16 Trim the joins to about a 4cm rim. Seal the rim with the edge of a fork or spoon handle.\nSTEP 17 Glaze all over with more egg yolk and, using the back of a knife, mark the beef Wellington with long diagonal lines taking care not to cut into the pastry.\nSTEP 18 Chill for at least 30 mins and up to 24 hrs. Heat oven to 200C/fan 180C/gas 6.\nSTEP 19 Brush the Wellington with a little more egg yolk and cook until golden and crisp – 20-25 mins for medium-rare beef, 30 mins for medium. Allow to stand for 10 mins before serving in thick slices.',_binary 'RIFF$\0\0WEBPVP8X\n\0\0\0\0\0\0v\0T\0VP8 H\0\0*wU>1C\"!!!@@	dl0fO\Is\\+z\'޿`\\\r+ʻ?\\yߥ?\	gIO\O\?1VGy\%c\\O_\0\\\E\\r\\\\\_W\_\>?\\!\O\|\\\x\\1>ʾ\\\ 7#/a\\.\w?x\\=i\7b,}{\#\zc\\\\vUq\qRE8ram*37{W\n\08ފ\\MҔr\C\"\\Ê_\\c\\Mi\&s\EGdˡc\-c6l}\\#ʷW\F8Y%x}c}\'oi*D;	\"f\J\x\i_~\G֛\=N%\\\P&5#hNN\\Zڗw\\\C\R\Q0W}\\\&t\T\'\\	$h\c\Q\\|\рN\/rMݽW\n`ٟH\?\0q\́Q\Ig-ka/l[\\lt\K\rM2Fi\0\L\\Z%}\x~`\َc@\	>\":rIA\%\\{\gwԂ\˓\\iA#Q\nZe{╘\\M1Ϭ+)\d\i`h\<ְ<$z\\\\\Quzꮲ\+67\y\\\0?\\T%)lkg6m^y#3\\L\s\Di\\\r`yM\\\O\\)1`\U\ǨQZ\u^e\\\rߦ\\'\nk;\`\+A\,T3p#\ߧ@6\\C\`u\\%LcPk\,Bu\B\Z6o\Q\$\*(\B\\$7soY65S\3En\s=T\r\n\\'Z*~㵘\0\ALWc@U\\'1ΐ\~uJ_.\إ\56\M\n\\Wr\Pż\ZI5E[{=\n\\%O	Wv\&Y@~L>t+-Jd*\\7m\\z4B:\W\\=V\\.]\o\\%\e\Ȭ#l\0S\\'B҉B\젤nm\E\Z2c%\l\A\ZD\\[0 cG\\!\߫ <q6\9\\1=)\\\>h\?\nݱ{\A\QX\blJ\؜u\U*\3=\\\TfPP%\Z\E\\\g2\\.,\\\\=\_Wc=Q-*\fi\/\8rc\ez\[\ u\\\qݢ\\1fW\u7kك汌miΧ\\d\P>T\\G-[\4,\߁\/15\37ҭ\s;-\\b\;`6\y\Z\bE-{nWvN\g\\3C\\\<j\#h(\ZX/SsA&!!\8\h&/[)R\I\y\!A_\@(\\Fci$\M:\s}yF\\+hQ\\\\>V~]`\/\VU]f\?\q\y1\Qe\\ɗ\+G\^Pמn:\Z\L\Ma~c_k\G*\\9\0+*\=\5ƾ{`b3\o77\} c\u\yԀ\a\\\#/-ֳ%CMV,\r\\\;,R\j\L\\\W.y疻ߖ\\VxS\<b-9\鐾\\\/0yһ\Z:B\re\AzWn\'uH7\UH\\\\'8	\R2zѥ\07x#\\"HZY\\љSkT\\{\\E4#;<d6/\T\.h,v\\w`r RtGN\=e\洷@_	F2\\\Zծp6Dp\J+`{\nX̹=UtYF#@\\"4\H0@=\֌w\=u+\ܕr!Z\\\mLxs\@/\Z\kfOgYO\"\LVBs\)P98(Y3\\\s\a\iVG\\\\\JW1}J\0K\\}l\f	S\e\hz\w/\,ebR\\r9\\Ȍ\n\\\-\qѵ\i\ClT\2!(Y㧉\;l\1rMwou\/\Z4\a\\l\,\X\0E\+\9\\I\"^\n\{\'di\K ҂\ny3s(,Ky\HDdaORт\^r\&F\\n:ƖE3\Ա\Zo\Z	5\\Ъ=:b\">(ru*\j\e\\V\n\	\q}\9ƙGE\\"I\\Zq\wrM\=0EU_=2\ٕG\A\F\rrqEUtE!\\'\i2MMO\\{g1\\֩^Wnh>4Dlky\Z{ \\є\'7ם\'k`\p(c+S)\\n|\\9(\[LdC\Alx\Wv\lOsW㠽vr϶.Cm.\aɕ%uj͒i\\b\$\E\@#\g~\<j?\$\\\ڷQgIu\0\0nؾK